import React from 'react';
import './css/HomePage.css';

const HomePage = () => {
  return (
    <div id="HomePage">
      <div
        id="picture"
        style={
          {
            backgroundImage: `url("${process.env.PUBLIC_URL}/Pictures/homepage_background_picture.jpg")`,
            backgroundPosition: 'center',
            backgroundRepeat: 'no-repeat',
            backgroundSize: '100%',
            height: '500px',
            display: 'flex',
          }
        }
      >
        <p style={
          {
            color: 'white',
            fontSize: '8em',
            textAlign: 'center',
            margin: 'auto',
          }
        }>WILD CIRCUS 2.0</p>
      </div>
      <div id="performances">
        <div id="laugh">
          <p>toto</p>
        </div>
        <div id="dream">
          <p>tata</p>
        </div>
        <div id="marvel">
          <p>tutu</p>
        </div>
      </div>
    </div>
  )
}

export default HomePage;
